function loadStaff(t,a){for(var f=$("<tbody></tbody>"),n=0;n<t.length;n++){var e=t[n];f.append('<tr><td><img src="https://crafatar.com/renders/body/'+e.uuid+'?helm&scale=5"></td><td><h2>'+e.name+"</h2><p>Chat name: "+aCodesToHTML(a[e.rank]+("off"===e.nick?e.name:e.nick))+"<br>"+e.desc+"</p></td></tr>")}$("#staff-table").append(f)}$.getJSON("json/staff/staff.json",function(t){$.getJSON("json/staff/prefixes.json",function(a){loadStaff(t,a)})});
